}

const Nav = () => {
    const [modal, setModal] = useState(false);

    return (
        <div className='fixed flex p-7 w-full items-center z-50'>
            <div className='flex-1'>
                <Link to={'/'} className='font-bold text-xl text-white text-opacity-40 hover:text-opacity-80'>Stagelink</Link>
